import "./Navbar.css";
import {Link} from "react-router-dom";
import { MenuItems } from "./MenuItems";

function Navbar() {
    return (
        <nav className="NavbarItems">
            <h1 className="navbar-logo">Pong</h1>
            <ul className="nav-menu">
                {MenuItems.map}
                <li>
                    <a href="/">
                        <i className="fa-solid fa-house"></i>Home
                    </a>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
